Once your Verifiable Presentation has been signed you can proceed to verify it with the verify method. If you've used DIDs you need to pass a resolver for them. You can also use the booleans compactProof (to compact the JSON-LD) and forceRevocationCheck (to force revocation check). Please beware that setting forceRevocationCheck to false can allow false positives when verifying revocable credentials. If your credential has uses the status field, you can pass a revocationAPI param that accepts an object describing the API to use for the revocation check. For the simplest cases you only need a challenge string and possibly a domain string: > const results = await vp.verify('some_challenge', 'some_domain');
> results
<- { "presentationResult": { "verified": true, "results": [ { "proof": { "@context": "https://w3id.org/security/v2", "type": "EcdsaSecp256k1Signature2019", "created": "2020-04-14T20:57:01Z", "challenge": "some_challenge", "domain": "some_domain", "jws": "eyJhbGciOiJFUzI1NksiLCJiNjQiOmZhbHNlLCJjcml0IjpbImI2NCJdfQ..MEUCIQCTTpivdcTKFDNdmzqe3l0nV6UjXgv0XvzCge--CTAV6wIgWfLqn_62U8jHkNSujrHFRmJ_ULj19b5rsNtjum09vbg", "proofPurpose": "authentication", "verificationMethod": "https://gist.githubusercontent.com/faustow/13f43164c571cf839044b60661173935/raw" }, "verified": true } ] }, "verified": true, "credentialResults": [ { "verified": true, "results": [ { "proof": { "@context": "https://w3id.org/security/v2", "type": "EcdsaSecp256k1Signature2019", "created": "2020-04-14T20:49:00Z", "jws": "eyJhbGciOiJFUzI1NksiLCJiNjQiOmZhbHNlLCJjcml0IjpbImI2NCJdfQ..MEUCIQCCCRuJbSUPePpOfkxsMJeQAqpydOFYWsA4cGiQRAR_QQIgehRZh8XE24hV0TPl5bMS6sNeKtC5rwZGfmflfY0eS-Y", "proofPurpose": "assertionMethod", "verificationMethod": "https://gist.githubusercontent.com/faustow/13f43164c571cf839044b60661173935/raw" }, "verified": true } ] } ] } Please note that the verification is an async process that returns an object when the promise resolves. This object contains separate results for the verification processes of the included Verifiable Credentials and the overall Verifiable Presentation. A boolean value for the entire verification process can be checked at the root level verified property.
